// App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { MyContextProvider } from './context/MyContext'; // Adjust the import as needed
import Navbar from './components/navbar';
import Blog from './components/blog'; // Adjust the import based on your file structure
import Hero from './components/hero'; // Assuming other components are used
import About from './components/About';
import Services from './components/Services';
import Testimonials from './components/Testimonials';
import PropertyListing from './components/PropertyListing';
import Team from './components/Team';
import Contact from './components/Contact';
import ParallaxSection from './components/ParallaxSection';
import Footer from './components/Footer';

function App() {
  return (
    <MyContextProvider>
      <Router>
        <div className="App">
          {/* Conditionally render Navbar based on the current route */}
          {/* The blog route path is checked to determine whether to show the Navbar */}
          <Navbar />
          <Routes>
            <Route path="/" element={
              <>
                <Hero />
                <About />
                <Services />
                <Testimonials />
                <PropertyListing />
                <Team />
                <Contact />
                <ParallaxSection />
                <Footer />
              </>
            } />
            <Route path="/blog" element={<Blog />} />
            {/* Add other routes here, and they will show the Navbar */}
          </Routes>
        </div>
      </Router>
    </MyContextProvider>
  );
}

export default App;
